params.text:
{% for license in CTX.licenses %}
{% if license.expirationDate is not none and (license.expirationDate| load_datetime('%Y-%m-%dT%H:%M:%SZ') |format_datetime('%Y-%m-%d')  == CTX.sixty_days_ago)%}
---------------------------------------------------------------------------------------------
    Activation Date: {{ license.activationDate }}
    Expiration Date: {{ license.expirationDate }}
    Device Type: {{ license.licenseType }}
{% endif %}
{% endfor %}

{% for license in CTX.licenses %}
{%set starting_date = license.startedAt| load_datetime('%Y-%m-%dT%H:%M:%SZ') | format_datetime('%Y-%m-%d') %}
    {% set expirationDate =  starting_date | time_delta (days=license.duration|int)%}
    {% if license.expired == false and expirationDate == CTX.thirty_days_ago and license.invalidated == false %}
    ---------------------------------------------------------------------------------------------
        License Needed:
        Activation Date: {{ license.startedAt }}
        Expiration Date: {{ expirationDate }}
        Device Type and count: {{ license.counts }}
    {% endif %}
{% endfor %}

